import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import { WorldDataProvider } from "./components/WorldDataContext";
import Firebase, { FirebaseProvider } from "./firebase/";

ReactDOM.render(
  <React.StrictMode>
    <WorldDataProvider>
      <FirebaseProvider>
        <App />
      </FirebaseProvider>
    </WorldDataProvider>
  </React.StrictMode>,
  document.getElementById("root")
);
